import React from 'react';
import './styles.css';

export default function Footer() {
    const footerImage = require('../../Assets/Images/rodape-desktop.jpg');

    return (
        <div className="home-container">
            <div className="content">
                <img className="image-footer" src={footerImage} alt=""/>
                <div className="about">
                    <p className="about-data">Fulano Beltrano de Oliveira da Silva</p>
                    <p className="about-data">fulanobos@gmail.com</p>
                    <p className="about-data">(31) 9 9666-1111</p>
                    <p className="about-data">Faculdade de Belo Horizonte</p>
                </div>
            </div>
        </div>
    );
}
